const isAnagram = (s, t) => {
  // first method
  //   if (s.length !== t.length) {
  //     return false;
  //   }

  //   const count = {};
  //   for (let char of s) {
  //     count[char] = (count[char] || 0) + 1;
  //     console.log(count);
  //   }

  //   for (let char of t) {
  //     // If return 0, null or undefined
  //     if (!count[char]) return false;
  //     count[char]--;
  //   }

  //   return true;

  //   second method
  if (s.length !== t.length) {
    return false;
  }

  const countS = {};
  const countT = {};

  for (let i = 0; i < s.length; i++) {
    countS[s[i]] = (countS[s[i]] || 0) + 1;
    countT[t[i]] = (countT[t[i]] || 0) + 1;
  }

  for (const key in countS) {
    if (countS[key] !== countT[key]) {
      return false;
    }
  }
  return true;
};

